import React from "react";
import "../App.css";

const constan = (
  <div>
    <div class="container-fluid row" style={{ paddingTop: "30px" }}>
      <h4 class="mb-4">
        Agregar nuevo caso{" "}
        <a
          class="btn text-white"
          style={{ backgroundColor: "#0796d8" }}
          href="#!"
          role="button"
        >
          <i class="fas fa-plus"></i>
        </a>
      </h4>
    </div>
  </div>
);

function ejemplo() {
  return constan;
}

export default ejemplo;
